function Header() {
    return (
      <div className="App">
        <nav className="navigation">
          <a href="#home">Home</a>
          <a href="#shop">Shop</a>
          <a href="#blog">Blog</a>
          <a href="#contact">Contact</a>
        </nav>
      </div>
    );
  }
  
  export default Header;
